import React, { Component } from "react";
import ReactDOM from "react-dom";
//import ReactCardCarousel from "react-card-carousel";
import SkillsetCard from "./component/skillset-card";

// Default theme
import '@splidejs/splide/css';

// or other themes
import '@splidejs/splide/css/skyblue';
import '@splidejs/splide/css/sea-green';

// or only core styles
import '@splidejs/splide/css/core';


const styleSkillset = {
  display: "flex",
  flexDirection: "column",
  justifyContent: "center",
  alignItems: "center",

  paddingTop: "100px",
  paddingBottom: "100px"
}

function Skillset() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <div style={styleSkillset}>
      <h1 style={{margin : "5px", paddingBottom : "50px"}}>Skillset</h1>

      <div class="swiffy-slider">
          <ul class="slider-container">
              <li><img src="https://source.unsplash.com/49b9l_29ceA/1600x900" style="max-width: 100%;height: auto;" /></li>
              <li><img src="https://source.unsplash.com/nKAglN6HBH8/1600x900" style="max-width: 100%;height: auto;" /></li>
              <li><img src="https://source.unsplash.com/E9ZwWcMGzj8/1600x900" style="max-width: 100%;height: auto;" /></li>
          </ul>

          <button type="button" class="slider-nav"></button>
          <button type="button" class="slider-nav slider-nav-next"></button>

          <div class="slider-indicators">
              <button class="active"></button>
              <button></button>
              <button></button>
          </div>
      </div>
    </div>
  );
}

export default Skillset;
